import React from 'react';

const Contact = () => (
  <div className="pt-24 min-h-screen bg-gray-900">
    <h1 className="text-5xl text-center py-10 font-bold text-blue-400">Contact</h1>
    <p className="text-center text-xl text-gray-300">Get in touch!</p>
  </div>
);

export default Contact;
